Исполнитель (executor) отвечает за планирование и запуск задач. Приостановка задачи: При использовании ключевого слова await, выполняемая задача приостанавливается. Текущее состояние, включая приоритет, контекст и локальные переменные сохраняются. В рантайме создается ContinuationAsyncContext для управления состоянием задачи, гарантируя возобновление задачи позже. Хранение состояния для возобновления: Continuation хранит данные таким образом, чтобы исполнитель или рантайм имели доступ к задаче во время приостановки. Обычно эти данные используются при добавлении задачи в очередь и последующего возобновления. Возобновление задачи: После завершения приостановки await, задача попадает в очередь соответствующего исполнителя, который планирует возобновление задачи. Runtime восстанавливает состояние задачи, позволяя возобновить выполнение async функции с того места, где она (функция) была приостановлена. У каждой возобновляемой задачи имеется ContinuationStatus: #https://github.com/apple/swift/blob/main/include/swift/ABI/Task.h
#
/// Status values for a continuation. Note that the "not yet"s in
/// the description below aren't quite right because the system
/// does not actually promise to update the status before scheduling
/// the task. This is because the continuation context is immediately
/// invalidated once the task starts running again, so the window in
/// which we can usefully protect against (say) double-resumption may
/// be very small.
enum class ContinuationStatus : size_t { /// The continuation has not yet been awaited or resumed. Pending = 0, /// The continuation has already been awaited, but not yet resumed. Awaited = 1, /// The continuation has already been resumed, but not yet awaited. Resumed = 2
